import React from 'react';
import {Button} from '@material-ui/core';


export const Money = () => {

  return (
    <div>
      <h1>Money Status</h1>
      <h3>Total money ==> 10,000</h3>
      <form>
        <Button variant="contained" color="primary" >Create Coins</Button>
      </form>
      <button  onClick={e => {
              this.showModal();
         }}
          > show Modal </button>
    </div>

  )
}
